ALLDATA = {}
PRINTDATA = [{
  name: "housedata",
  children: []
  }]

def processdata

  populateorgs
  populateprogs
  populatedetails
  formatdata

  printData = PRINTDATA.to_json
  File.write('data.json', printData)
  # p orgs
end

def populateorgs
  MYDATA.each do |x|
    org = x[:organization]
    prog = x[:program]
    desc = x[:description]
    size = x[:ytd_amount]

    if !ALLDATA[org]
      ALLDATA[org] = {
        name: org,
        children: {}
      }
    end
  end
end

def populateprogs
  MYDATA.each do |x|
    org = x[:organization]
    prog = x[:program]
    desc = x[:description]
    size = x[:ytd_amount]

    if !ALLDATA[org][:children][prog]
      ALLDATA[org][:children][prog] = {
        name: prog,
        children: []
      }
    end
  end
end

def populatedetails
  MYDATA.each do |x|
    org = x[:organization]
    prog = x[:program]
    desc = x[:description]
    size = x[:ytd_amount]

    ALLDATA[org][:children][prog][:children].push({name: desc, size: size})

  end
end

def formatdata

  ALLDATA.each do |org,v|
    orgchildren = []
    v[:children].each do |prg,w|
      orgchildren.push(w)
    end
    v[:children] = orgchildren
    PRINTDATA[0][:children].push(v)
  end
  p '.............'
  p ALLDATA
  # p PRINTDATA
end

